     ledr_n, ledg_n, flash_csb, flash_clk, flash_io0, flash_io1,
     flash_io2, flash_io3);
  input clk, ser_rx;
  output ser_tx, led1, led2, led3, led4, led5, ledr_n, ledg_n,
       flash_csb, flash_clk;
  inout flash_io0, flash_io1, flash_io2, flash_io3;
  wire clk, ser_rx;
  wire ser_tx, led1, led2, led3, led4, led5, ledr_n, ledg_n, flash_csb,
       flash_clk;
  wire flash_io0, flash_io1, flash_io2, flash_io3;
  wire clk_PAD, flash_clk_PAD, flash_csb_PAD, led1_PAD, led2_PAD,
       led3_PAD, led4_PAD, led5_PAD;
  wire ledg_n_PAD, ledr_n_PAD, ser_rx_PAD, ser_tx_PAD;
  icebreaker soc(.clk (clk_PAD), .ser_tx (ser_tx_PAD), .ser_rx
       (ser_rx_PAD), .led1 (led1_PAD), .led2 (led2_PAD), .led3
       (led3_PAD), .led4 (led4_PAD), .led5 (led5_PAD), .ledr_n
       (ledr_n_PAD), .ledg_n (ledg_n_PAD), .flash_csb (flash_csb_PAD),
       .flash_clk (flash_clk_PAD), .flash_io0 (flash_io0), .flash_io1
       (flash_io1), .flash_io2 (flash_io2), .flash_io3 (flash_io3));


  pad_in clk_pad(.pad (clk), .DataIn (clk_PAD));
  pad_out flash_clk_pad(.DataOut (flash_clk_PAD), .pad (flash_clk));
  pad_out flash_csb_pad(.DataOut (flash_csb_PAD), .pad (flash_csb));
  pad_out led1_pad(.DataOut (led1_PAD), .pad (led1));
  pad_out led2_pad(.DataOut (led2_PAD), .pad (led2));
  pad_out led3_pad(.DataOut (led3_PAD), .pad (led3));
  pad_out led4_pad(.DataOut (led4_PAD), .pad (led4));
  pad_out led5_pad(.DataOut (led5_PAD), .pad (led5));
  pad_out ledg_n_pad(.DataOut (ledg_n_PAD), .pad (ledg_n));
  pad_out ledr_n_pad(.DataOut (ledr_n_PAD), .pad (ledr_n));
  pad_in ser_rx_pad(.pad (ser_rx), .DataIn (ser_rx_PAD));
  pad_out ser_tx_pad(.DataOut (ser_tx_PAD), .pad (ser_tx));


       
endmodule

